import React from 'react';
import './reportform.css';

function ReportForm(){

    function fileuploaded(){
        document.getElementById("upload-img").style.display = "none";
        document.getElementById("after-upload").style.display = "block";
        document.getElementById("repo1-2-2").style.display = "initial";
        document.getElementById("repo1-1-2").style.display = "none";
        document.getElementById("repo1-1-21").style.display = "block";
    }

    function uploadagain(){
        document.getElementById("upload-img").style.display ="block" ;
        document.getElementById("after-upload").style.display = "none";
        document.getElementById("repo1-2-2").style.display = "none";
        document.getElementById("repo1-1-2").style.display = "block";
        document.getElementById("repo1-1-21").style.display = "none";

    }
    function addsubmit(){
        document.getElementById("repo1-3-2").style.display = "initial";
 }
    return(
        <div class="repo1">
		<button type="button" class="back " onClick="#">
		        <img class="back-1" src="icon/Vector.png"  alt="noimage"/>            
		</button>
			<nav class="navbar ">
	  <div >
		  <button type="button" class="page3-2" data-toggle="collapse" data-target="#myNavbar">
		        <img class="step-5" src="icon/menu.png"  alt="noimage"/>            
		  </button>
	   </div>
		<div class="page3-1 dropdown-menu dropdown-menu-right " id="myNavbar">
		  <ul class=" abcd  ">
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/login-16 (1).png"  alt="noimage"/> Login</a></li><br/>
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/Group 14.png"  alt="noimage"/>Stats</a></li>
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/Group 15.png"  alt="noimage"/>What is a violation?</a></li>
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/Group 16.png"  alt="noimage"/>Useful Links</a></li>
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/Group 17.png"  alt="noimage"/>Share app with friends</a></li>
			<li class="abcd"><a href="#"><img class="nav-icon" src="icon/Group 19.png"  alt="noimage"/> Logout</a></li><br/>
		  </ul>
		</div>
		<div class="repo1-1">
				<p class="repo1-1-1">Report violation </p>
				<img id="repo1-1-2" src="icon/Group 50.png"  alt="noimage"/>
				<img id="repo1-1-21" src="icon/1 filed.png"  alt="noimage"/>
			</div>
	 </nav>
	<div class="repo1-2">
		 <div > <img class="repo1-2-1" src="icon/Group 52.png"  alt="noimage"/><img id="repo1-2-2" src="icon/Group.png"  alt="noimage"/></div>

				<label for="file-input">
					<p class="upload-pic">Upload Picture</p><img  id="upload-img" src="icon/Group 7.png" onClick={fileuploaded} alt="noimage"/>
				</label> 
				<input  id="file-input" type="file" />

				<div id="after-upload">
					<button class="reupload" type="button" onClick={uploadagain}>Reupload</button>
					<img id="uploded-img" src="icon/VES_Awards_89_cropped 1.png"  alt="noimage"/>
				</div>
		</div>
		 <div class="repo1-3 "><div >  <img class="repo1-2-1" src="icon/Group 53.png"  alt="noimage"/><img id="repo1-3-2" src="icon/Group.png"  alt="noimage"/></div>
		<form action="/action_page.php">
			<label for="Add" class="page3-2-2">Address</label><br/>
			<input type="text" class="add page3-2-2-2"  name="add" placeholder="  Address where the violation happened" required /><br/>

				<label for="City" class="page3-2-2">City</label>
				<label for="State" class="page3-2-2-1">State</label><br/>

				<input type="text" class="City page3-2-2-2" name="City" required /> 
				<input type="text" class="State page3-2-2-2" name="State" required /><br/>
			    <label for="Pin" class="page3-2-2-1">Pin</label><br/>
				<input type="number" class="pin page3-2-2-2" name="Pin" required /><br/>
			 <input type="submit" class="submit"  onclick="addsubmit()" value="Next     >"/>
		</form> 
		</div>

	</div>
    );
}

export default ReportForm;
